import React from 'react';

const NewCardPopUp = ({togglePopUp}) => {

  const handleToggle = _ => {
    togglePopUp();
  }
  return (
    <div className="new-card-component">
        NEW CARD!!!
        <button onClick={handleToggle}>close</button>
    </div>
  )
}

export default NewCardPopUp;
